            Console.WriteLine(BitConverter.ToString(a.ToArray()).Replace("-", ""));

            Reader br = new Reader(
                " "
                    .HexaToBytes());
            int b = br.ReadInt32();
            for (int i = 0; i < b; i++)
            {
                Console.WriteLine(i);
                Console.WriteLine($"Clan ID {br.ReadInt64()}");
                Console.WriteLine($"Clan Name {br.ReadString()}");
                br.ReadInt32();
                br.ReadInt32();
                br.ReadInt32();
                br.ReadInt32();
                br.ReadInt32();
                br.ReadInt32();
                br.ReadInt32();
                br.ReadInt32();
                br.ReadInt32();
                br.ReadInt32();
                br.ReadInt32();
                br.ReadInt32();
                br.ReadInt32();
                br.ReadInt32();
                br.ReadInt32();
                br.ReadInt32();
                br.ReadByte();
                br.ReadByte();
            }

            var data = br.ReadFully();
            Console.WriteLine(BitConverter.ToString(data).Replace("-", ""));
            Console.WriteLine(Encoding.UTF8.GetString(data));
        }

    }
